    //Rendering
    public Shader shader;
    private Material material;
    public Color color = Color.green;

    //GameObject
    private GameObject fontGameObject;
	public Transform parent = null;
    public Vector3 position = Vector3.zero;
    public Vector3 scale = Vector3.one;
    public float speed = 10.0f;

    byte[] ASCIIValues;
    bool done = false;
    bool drawPrev = false;

    Vector3[] lp = new Vector3[0];
    Vector3 currentPosition = Vector3.zero;
    Vector3 cursorPosition = Vector3.zero;
    Vector3 start = Vector3.zero;
    Vector3 end = Vector3.zero;
    int     strIdx = 0;
	int     idx = 0;
    int     lineno = 0;
	float 	dt = 0.0f;
	float 	totalTime = 0.0f;
	float   t = 1.1f;
    System.Action callback = null;

	// Use this for initialization
	void Start () 
	{
		fontGameObject = new GameObject("fontGameObject");
        if (parent)
        {
            fontGameObject.transform.parent = parent;
            fontGameObject.transform.localPosition = position;
            Vector3 parentScale = parent.transform.localScale;
            fontGameObject.transform.localScale = new Vector3(scale.x/parentScale.x, scale.y/parentScale.y, scale.z/parentScale.z);
        }
        else
        {
            fontGameObject.transform.position = position;
            fontGameObject.transform.localScale = scale;
        }

		material = new Material(shader);
		material.color = color;
        text += " ";
        ASCIIValues = System.Text.Encoding.ASCII.GetBytes(text+" ");
	}

	public GameObject GetGameObject()
	{
		return fontGameObject;
	}

	public Vector3 GetCursorPosition()
	{
		return cursorPosition;
	}

	// Update is called once per frame
	void Update () 
	{
         DrawStringUpdate();
	}

	void ResetVariables()
	{
		currentPosition = Vector3.zero;
		cursorPosition = Vector3.zero; 
		lp = new Vector3[0];
		strIdx = 0;
		idx = 0;
		lineno = 0;
		dt = 0.0f;
		totalTime = 0.0f;
		t = 1.1f;
		done = false;
		drawPrev = false;
	}

	public void DrawString(string text_, HERSHEY font_=HERSHEY.astrology, System.Action callback_=null)
    {
        if (text_.Length <= 0)
        {
            text = "";
            done = true;
            return;
        }
		fontName = font_;
        callback = callback_;
        text = text_ + " ";
        ASCIIValues = System.Text.Encoding.ASCII.GetBytes(text);
		ResetVariables();
    }

	void DrawStringUpdate()
	{
		if(done)
			return;

		if(t>1.0f)
		{
			int asciiValue = ASCIIValues[strIdx];
			if(asciiValue<32 || asciiValue>125)
			{
				if(asciiValue==10)//|| asciiValue==13)
				{
                    float height = hershey_height[(int)fontName];
                    currentPosition = new Vector3(position.x, currentPosition.y, position.z) - new Vector3(0.0f, height, 0.0f);
				}
				strIdx++;
				return;
			}

			idx = asciiValue - 32;
            float[][] font = hershey[(int)fontName];
            float[] gylph = font[idx];

			//Debug.Log("StrIdx " + strIdx.ToString() + " asciiValue " + asciiValue.ToString() +" idx "+idx.ToString());

			if(lineno>0 || drawPrev)
			{
				drawPrev = false;
				lp = AddLine(lp, start, end, false);
			}

			float xOff = 0.0f;

            /*if (fontName == HERSHEY.cursive)
            {
                if (idx == 70)
                {
                    xOff = -0.5f;
                }
                else if (idx == 74)
                {
                    xOff = -0.8f;
                }
                else if (idx == 80)
                {
                    xOff = -0.4f;
                }
            }*/

			start = new Vector3(gylph[lineno]+xOff,-gylph[lineno+1], 0.0f)+currentPosition;
			end = new Vector3(gylph[lineno+2]+xOff,-gylph[lineno+3], 0.0f)+currentPosition;
			float d = Vector3.Magnitude(end - start);
			totalTime = d/speed;
			dt = 0.0f;
			t = 0.0f;

			lineno+=4;
			if(lineno>=gylph.Length)
			{
				drawPrev = true;
				lineno = 0;
                float[] font_with = hershey_width[(int)fontName];
                float width = font_with[idx];
				currentPosition += new Vector3(width,0.0f,0.0f);
				strIdx++;
				if(strIdx>=text.Length)
				{
					done = true;
                    if (callback != null)
                    {
                        callback();
                    }
					return;
				}
			}
		}		
		else
		{
			dt += Time.deltaTime;
			t = dt/totalTime;
			Vector3  i = Vector3.Lerp(start, end, t);
			lp = AddLine(lp, start, i, true);
			cursorPosition = fontGameObject.transform.TransformPoint(i);
		}
	}

	public void PrintString(string text_, HERSHEY font_=HERSHEY.astrology)
    {
        text = text_;
		fontName = font_;
        ASCIIValues = System.Text.Encoding.ASCII.GetBytes(text);

		ResetVariables();
        while (strIdx < text.Length)
        {
            int asciiValue = ASCIIValues[strIdx];
            //Debug.Log("StrIdx " + strIdx.ToString() + " asciiValue " + asciiValue.ToString());
            if (asciiValue < 32 || asciiValue > 125)
            {
                if (asciiValue == 10)//|| asciiValue==13)
                {
                    float height = hershey_height[(int)fontName];
                    currentPosition = new Vector3(position.x, currentPosition.y, position.z) - new Vector3(0.0f, height, 0.0f);
                }
                strIdx++;
                return;
            }

            idx = asciiValue - 32;
            float[][] font = hershey[(int)fontName];
            float[] gylph = font[idx];

            //Debug.Log("StrIdx " + strIdx.ToString() + " asciiValue " + asciiValue.ToString() +" idx "+idx.ToString());

            float xOff = 0.0f;

            /*if (fontName == HERSHEY.cursive)
            {
                if (idx == 70)
                {
                    xOff = -5.0f;
                }
                else if (idx == 74)
                {
                    xOff = -8.0f;
                }
                else if (idx == 80)
                {
                    xOff = -4.0f;
                }
            }*/

            lineno = 0;
            while (lineno < gylph.Length)
            {
                start = new Vector3(gylph[lineno] + xOff, -gylph[lineno + 1], 0.0f) + currentPosition;
                end = new Vector3(gylph[lineno + 2] + xOff, -gylph[lineno + 3], 0.0f) + currentPosition;
                lp = AddLine(lp, start, end, false);
                lineno += 4;
            }
            float[] font_with = hershey_width[(int)fontName];
            float width = font_with[idx];
            currentPosition += new Vector3(width, 0.0f, 0.0f);
            strIdx++;
        }

        done = true;
    }

	void OnPostRender() 
	{
		material.SetPass(0);
		GL.PushMatrix();
		GL.MultMatrix(fontGameObject.transform.transform.localToWorldMatrix);
		GL.Begin( GL.LINES );
		GL.Color(color);
		
		for(int i = 0; i < lp.Length; i++) {
			GL.Vertex3(lp[i].x, lp[i].y, lp[i].z);
		}
		
		GL.End();
		GL.PopMatrix();
	} 

	Vector3[] AddLine(Vector3[] l, Vector3 start, Vector3 end, bool tmp) 
	{
		int vl = l.Length;
		if(!tmp || vl == 0) l = resizeVertices(l, 2);
		else vl -= 2;
		
		l[vl] = start;
		l[vl+1] = end;
		return l;
	}
	
	Vector3[] resizeVertices(Vector3[] ovs, int ns)
	{
		Vector3[] nvs = new Vector3[ovs.Length + ns];
		for(int i = 0; i < ovs.Length; i++) nvs[i] = ovs[i];
		return nvs;
	}

